const Menu = () => {
    return (
        <div>
            <ul className="nav nav-tabs bg-dark">
                <li className="nav-item">
                    <a className="nav-link" href="">Home</a>
                </li>
                <li className="nav-item">
                    <a className="nav-link" href="">Sign In</a>
                </li>
            </ul>
        </div>
    )
}
export default Menu;
